import dogFacade from "../dogFacade";


const Admin = () => {
    const [adminData, setAdminData] = useState("Loading...")

    useEffect(() => {
      dogFacade.getAdmin().then(data => setAdminData(data.msg));
    }, []);

    return (
      <div>
        <h1>Hello! Just testing admin!</h1>
        <h2>{adminData}</h2>
      </div>
    );
  };

  export default Admin;
